import {ImageBackground, StyleSheet, View, Text, Image} from 'react-native';
import React from 'react';
import { TouchableOpacity } from 'react-native-gesture-handler';

export default function MyMaps ({navigation}) {

  const handlePress = () => {
    navigation.replace('Dashboard');
  };
  
  return (
      <View style={styles.container}>
        <Text style={styles.title}>MyMaps</Text>
        <TouchableOpacity style={styles.button} onPress={handlePress}>
          <Text style={styles.buttonText}>Back</Text>
        </TouchableOpacity>
      </View>
  )
}

const styles = StyleSheet.create({
  container: {
    height: '100%',
    width: '100%',
    backgroundColor: '#FFFFFF',
    alignItems: 'center',
    justifyContent: 'center',
  },
  background: {
    flex: 1,
    backgroundColor: '#FFFFFF',
    justifyContent: 'center',
    alignItems: 'center',
  },
  button: {
    width: 250,
    borderRadius: 15,
    borderWidth: 3,
    borderColor: 'white',
    backgroundColor: '#0E2D6D',
    padding: 5,
    margin: '2%'
  },
  buttonText: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#FFFFFF',
    textAlign: 'center'
  },
  inlineText: {
    fontSize: 20,
    fontWeight: 'bold',
    color: 'navy',
    textAlign: 'center',
    marginTop: '5%',
  },
  title: {
    fontSize: 15,
    fontWeight: 'bold',
    color: 'black',
    textAlign: 'center'
  },
  titleContainer: {
    backgroundColor: '#FFFFFF',
    alignItems: 'center', 
    justifyContent: 'center',
    position: 'absolute',
    top: 30,
  },
});
